import React from 'react';

class Control extends React.Component {
  render(){
  return (
    <div className=" bg-black h-screen relative">
        <img  className="bg-cover  h-full absolute h-full opacity-50 " />
        <div className='container mx-auto py-10 '>
            <h1 className='text-4xl text-center text-gray-100	uppercase font-mono '>Thi trắc nghiệm bằng lái xe A1aaa</h1>
        </div>
    </div>
  );
}
}
export default Control;
